import React, { useState } from 'react';
import SquareButton from './SquareButton';
import * as enumerations from '../constants/enumerations';

export default function ProductStandouts() {
  return (
    <React.Fragment>
      <h2>About you</h2>
      <h3>Age Range</h3>
      <h4>
        Choose <span className="bold">One</span>
      </h4>
      <div className="square-buttons-container">
        <SquareButton value={enumerations.ageRange.first} />
        <SquareButton value={enumerations.ageRange.second} />
        <SquareButton value={enumerations.ageRange.third} />
        <SquareButton value={enumerations.ageRange.fourth} />
        <SquareButton value={enumerations.ageRange.fifth} />
        <SquareButton value={enumerations.ageRange.sixth} />
        <SquareButton value={enumerations.ageRange.seventh} />
      </div>
    </React.Fragment>
  );
}
